// let jsPDF = require('jspdf');
import { Component, OnInit } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { ActivatedRoute } from '@angular/router';
import * as jsPDF from 'jspdf';

@Component({
  selector: 'app-billing',
  templateUrl: './billing.component.html',
  styleUrls: ['./billing.component.css']
})
export class BillingComponent implements OnInit{

  bill;
  bills;
  receiptNr;
  accessCode;

constructor(private http: HttpClient, private route: ActivatedRoute) {    
  this.accessCode = route.snapshot.params['code']; 
  this.bill = {
      room1: 0,
      room2: 0,
      booking: 0
  }
}

  ngOnInit() {
  
    var requestBooking = "https://paardrijvakantie.com/api/getBill.php?code=" + this.accessCode;
    this.http.get(requestBooking).subscribe(data => {
      this.bills = data;
      if(this.bills) {
        this.bill = this.bills[0];
        var receiptNrBase =  this.bill.arrival.substr(0,4) + ".";
        var receipt_nr = 1000 + (this.bill.receipt_nr ? parseInt(this.bill.receipt_nr) : 0);
        this.receiptNr = receiptNrBase + receipt_nr.toString().substr(1,4);
        this.bill.room1_totalprice = this.bill.nights * this.bill.room1_price;
        this.bill.room2_totalprice = this.bill.nights * this.bill.room2_price;
       }
    });
  }

  generatePdf() {
    
    const doc = new jsPDF('p', 'pt', 'a4');
    
    // hide the button on the pdf
    var downloadButton = document.getElementById('download-button');
    if(downloadButton) {
      downloadButton.className += downloadButton.className ? ' hideButton' : 'hideButton';
    }

    // part of the page to print
    var elementToPrint = document.getElementById('print-receipt');
    var options = {
      margins: {
      top: 300,
      bottom: 0,
      left: 200,
      right: 200
      }
    };

    // not working!!
    var imgData2 = "data:image/jpeg;base64," + btoa('https://paardrijvakantie.com/images/ladevezebanner1.jpg');
    
    // for now online converted the image
    var imgData = 'data:image/jpeg;base64,';
     
    doc.addHTML(elementToPrint, 0, 20, options, () => {
       doc.addImage(imgData, 'JPEG', 15, 25, 275, 110);   
       doc.save('facture-' + this.accessCode + '.pdf');
    });

    // show the button again
    downloadButton.classList.remove("hideButton");

    
  }  
}
